import React from 'react';
import './App.css';
import Navbar from './ Components/Navbar'
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './components/Home'

function App() {
  return (
  <Router>
    <Navbar />
    <Switch>
      <Route path='/' exact component={Home} />
    </Switch>
  </Router>
  );
}

export default App;
